import './App.css';
import React,{Component} from "react";
import Count from "./containers/Count";
//引入store
import store from "./redux/store";
import Person from "./containers/Person";
export default class App extends Component{

    render() {
        return(
           <div>
               {/*给容器组件传递store*/}
                <Count store={store}/>
                <hr/>
                <Person/>
           </div>
        )
    }
}
